import "./app.css";
import React, { Component } from "react";
import Habits from "./components/habits";

class App extends Component {
  render() {
    return (
      <>
        <nav>
          <h1>Habit Tracker</h1>
        </nav>
        <form action="submit">
          <input></input>
        </form>
        <Habits />
      </>
    );
  }
}

export default App;
